			"comment": "<strong>Встаём в шесть утра тред 4&#47;21</strong><br><br>Привет анон!<br><br>Пока ветераны ночного спят, накрутивштсь рулеточек, я приглашаю тебя в маленькую секту приобретателей полезных привычек (и бросателей вредных).<br><br>Я буду проверять на практике несколько утверждений из вылезаторской литературы:<br><br>- формирование привычки занимает 14-21 день<sup>1</sup><br>- соблюдению привычки способствует отчёт перед кем-нибудь<br>- недосып превращает человека в гибрид свиньи и зомби<sup>2</sup><br><br>Бороться буду с лишним весом, алкоголизмом и повышенной злобностью.<br><br>Исходные данные:<br>- 178&#47;90<br>- Эквивалент 150 граммов водки 4-6 раз в неделю<br>- Постоянно взъёбаное состояние<br><br>Что делаю:<br>- Каждое утро встаю ровно в шесть утра<br>- Взвешиваюсь и создаю тред с отчётом<br>- Иду полчаса гулять по парку, фотографирую уточек<br>- Готовлю и ем завтрак, собираюсь на работу<br>- Иду на работу, часть пути пешком, не заходя в макдак (я же позавтракал!)<br>- С работы тоже пешком часть пути<br>- В 11 отбой<br>- Никаких дополнительных танцев с бубном, типа диеты, качалок, бега и что там ещё принято<br>- В неделю можно один раз прибухнуть те самые 150<br><br>Днём треды не создаю, вечером тоже. Бампов со словом бамп не делаю, только отчёты, уточки и культурное общение, не семёню, галочку ориджинал постера надеваю.<br><br>Что делать дальше, будет видно через три недели.<br><br>---<br><sup>1</sup> Аноны в прошлом треде говорили - пара месяцев. Это больше похоже на правду, но я так далеко загадывать не буду<br><br><sup>2</sup> Говорят, ещё солнце и воздух нужны, вот как раз на прогулках и подышу<br><br>---<br>По просьбам анона в телеграме запилена конфа <em>utochki</em><br><br>Для худеющих к лету анонов в физаче есть жиротред, фак в шапке",
