			"comment": "Как перестать заниматься самообманом? Каждый раз говорю себе, что не буду фапать и каждый раз нарушаю этот обет. Пытаюсь завязать уже много лет, но в последние 3 года воля совсем иссякла и я впал в апатию и фрустрацию, да-да, меня ввергает в смуту моя адская зависимость от маструбации, и она меня губит уже столько лет. Все было бы гораздо проще, если бы мне было достаточно раз пофапать, но мне этого крайне мало и я каждый день кидаю по 3 палки, часто бывает и до 6-ти доходит. Но самое печальное это то, что я стал фапать на всякие извращенности. Особенно зацепил зоо-прон с девушками, на который адски стоит шишка а так же на хентай с оплодотворением тян всякой нечистью. Меня дико беспокоит данная проблема и начались развиваться навязчивые страхи, но сама соль в необучаемости, т.к. иногда я могу себе внушить правильную вещь, но на следующий день я о ней забываю и опят парюсь и самонакручиваю хуету, не забывая себя психически наказать за это. Как уже наверное стало понятно из написанного, я лиственник, тян никогда не было. <br>Аноны сталкивающиеся с подобной проблемой, подскажите как фиксить подобное дерьмо? Как перестать обманывать себя, и возвращаться на старые рельсы? ",
