			"comment": "Сап, двач. На связи кун 25 лвл (без пары месяцев). <strong>Организую тред неудач с тян <span class=\"spoiler\">божи, как орегенальна</span></strong> Запилю свою прохладную, не собираюсь ныть. <br><br>Короче, до 22-23 лет был пиздецки жирным (не 150 кг, но 90-100 весил при росте в 172), ничего удивительного, что с тян у меня не складывалось. Когда учился в кунивере, то в 2012 мне очень приглянулась одна тян - была на пару-тройку курсов младше меня, с красивыми серебристыми волосами. Так было построено расписание, что я шел в универ, а она шла из него, причем это был не самый популярный маршрут (и я, и она жили в обжитии, но не в одном, там комплекс целый). Я был настолько омеган, что взять и заговорить на улице просто не мог. Долго пытался пробить ее асечку<span class=\"spoiler\">-писечеку</span> или вк через левых знакомых (чтобы не очень навязчиво это было), но в итоге оказалось, что она в сети не сидела, либо усиленно шифровалась. Стоит упомянуть, что за год до этого я ее тоже видел (она тогда только поступила на первый курс), только тогда она гоняла с каким-то длиннободылым куном, а тут уже была одна. Короче, я долго думал как завязать знакомство и решился на такую романтическую хуйню как письмо. Реальное блядь бумажное письмо в конверте. Написал, что хотел бы с ней погулять, что-то о себе наплел, оставил номер мобилки. Дико очковал отдавать, просто очень дико, анон. Колотило неподетски. Даже вышел сильно раньше и в итоге отдал чуть ли ни на входе в кунивер. В итоге она мне скинула смс, короткая переписка, вроде как была не против погулять, но когда появится время. Потом замолчала. Мои сообщения игнорила. Я подумал, что мб у нее деньги кончились, закинул ее полтос на мобильник. Тишина. Не выдержал и решился позвонить. Первый звонок - не взяла, второй через пару часов - сбросила. И прислала сообщение в духе, мол не стоит ее больше беспокоить и вообще у нее парень есть. Так смешно сейчас, а пять лет назад я жестко пиздострадал. Конечно, все улеглось, хотя от нервов на этой почве у меня даже проблемы небольшие со здоровьем были. Ну и глупые мысли о суициде, не без этого. А спустя несколько лет я был на защите ее дипломной работы - работа ни о чем, полная хуетень, да и самой ей было не интересно все это, раз на вопросы толком не ответила. Сложилось ощущение, что она тупая как пробка. Не жалею что не сложилось (тем более потом она перекрасилась в дрисняво-коричневый цвет и весь шарм в облике потеряла). И да, если вы, аноны, совершаете подобную хуйню, то реагируйте на вопрос &quot;ты сам отдал письмо или кого-то попросил?&quot; Это означает (в моем случае <span class=\"spoiler\">да и во многих других, думаю</span>), что тян внешне ты не понравился от слова совсем. Удачи, няши, пилите свои прохладные, а я пошел курить.",
