			"comment": "Небольшой ночной версус: <strong>Dragon Age: Origins</strong> VS <strong>The Elder Scrolls V: Skyrim</strong><br><br>Тедас или Тамриэль?<br>Ферелден или Скайрим?<br>Создатель или Акатош? <br>Кайлан или Торуг? <br>Вилкой в глаз или в жопу раз?<br><br>Какая вселенная и какая из этих игр тебе больше по душе, анон? Драконы, охуительный сеттинг, глобальная пиздецома во вселенной и даже мёртвый король - всё это есть в обоих шедеврах игроиндустрии. Тебе лишь остаётся выбрать, какую из этих няш мне качать на выходные. <br><br>В ориджине дико цепляет боёвка и сюжет - столько интересной хуйни происходить в скайриме не происходит вообще. Раскачка героя куда интереснее, и уж тем более, если у меня целых 4 героя сразу. Пауза в бою, меты и стратегия - вот это всё. Легкая геймплейная линейность ничуть не мешает - отсутствие тупого гринда и цепляющие адвенчуры делают игру реально залипательной.<br><br>Скайрим же радует своей свободой развития и передвижения - делай что хочешь, лишь бы не сдохнуть на легендарке. Но, к сожалению, весь процесс ближе к концу дико остоебенивает - сказывается некоторая сырость, которая частично правится десятком модов. Впрочем, некоторым действительно доставляет прокачиваться ради прокачивания - сам таким был, пока не заебался.<br><br>Ну а что ты думаешь об этом, дружище?<br><br><br>",
