			"comment": "Итак, снова про путешествия во времени (ниже будет паста из прошлого треда)<br>Начну с того, что мне действительно кажется всё это недействительным. Нереальность путешествий во времени, а также тот факт, что я баловался с медитациями, тульпами и ОСами (без веществ) всё больше убеждают меня в том, что это что то вроде слишком затянутого сна. Прошел почти день, а мне уже страшно, что я не проснусь. Ну и капчую потому, что здесь есть те, кто ответят, да и вообще можно передавать свои страхи сюда. Здесь есть ощущение, что есть люди (с долей того, что все здесь - боты). Да и мне самому кажется сейчас, что несу полнную ахинею...<br>Вообщем, буду пока отталкиваться от того, что это реальность, ибо несмотря на вышесказанное, этот вариант рассматривать в разы интересней. Отвечу на некоторые вопросы:<br><br><span class=\"unkfunc\">&gt;дата &quot;отправки&quot;?</span><br>17 ноября 2017 года. Я вчера уснул в универе, а проснулся уже у себя дома в НН.<br><br><span class=\"unkfunc\">&gt;последствия?</span><br>Вроде ничего такого, никаких побочек <span class=\"spoiler\">аппетит проснулся довольно сильный, но лишь чуть сильнее обычного</span>. <br><br><span class=\"unkfunc\">&gt;отличия?</span><br>Пока не наблюдаю, но полгода же, не помню всё детально. <br><br><span class=\"unkfunc\">&gt;что там в будущем? </span><br>Я осознал, как лоханулся с терактом, поэтому во избежание вероятной поломки таймлайна критичные события не буду раскрывать, за остальным - задавайте ответы. Сразу оговорю, я интересуюсь гаджетами, немного онямкой, космосом, и отчасти ютубом, поэтому это те темы, на которые я могу вам что то сказать. Остальное - что смогу.<br><br><span class=\"unkfunc\">&gt;предпосылки?</span><br>Да, есть кое что,  и я этим озабочен. Часто, совершая какие либо действия, ну или вообще какие то моменты из жизни идут - возникает ощущение, что я их уже переживал, видел. Дежавю такое, знаете? Как лампочка загорается в голове, мол &quot;блин, а я ж это уже делал...&quot;. Началось это где то с лета 2016 - я четко помню первый такой звоночек, я тогда подавал документы в лицей (переводился в ЦОД, нижегородцы в курсе), и когда отдавал папку с документами меня осенило это самое чувство, я даже документы задержал в руке и дама-приёмщик прикрикнула на меня.<br><br>Вообщем вот, хз - если нереально, то надо бы просыпаться, если реально - надо извлекать пруфы (завел тетрадку для документирования матчей и игр).<br><br><span class=\"spoiler\">Когда тред утонет, я не буду наверное пересоздавать, и поэтому на всякий оставляю втентакль: &#47;cutiemark52<br> </span>",
